Description:
Bên mình công ty nghiên cứu thị trường, 
Muốn tìm kiếm freelancer có khả năng xây dựng app bằng React Native - chạy được trên cả Android và iOS; 
- Số lượng màn hình : 5 ~ 6 màn hình 
- Nội dung app : thu thập dữ liệu khảo sát 
- Thời gian : 2 tháng cho version đầu, 5 tháng cho bản hoàn chỉnh; 
Mong muốn hợp tác lâu dài sau khi release app; 
Thanh toán theo giai đoạn;
